import React, { useState } from "react"
import { Button, Container } from "react-bootstrap";
import CreateBrand from "../components/modals/CreateBrand";
import CreateType from "../components/modals/CreateType";
import CreateClothe from "../components/modals/CreateClothe";

const Admin = () => {
  const [showType, setShowType] = useState(false);
  const [showBrand, setShowBrand] = useState(false);
  const [showClothe, setShowClothe] = useState(false);

  return (
    <Container>
      <Button variant="primary" onClick={() => setShowType(true)}>
        Открыть модальное окно 1
      </Button>
      <CreateType show={showType} handleClose={() => setShowType(false)} />

      <Button variant="primary" onClick={() => setShowBrand(true)}>
        Открыть модальное окно 2
      </Button>
      {showBrand && <CreateBrand show={showBrand} handleClose={() => setShowBrand(false)} />}

      <Button variant="primary" onClick={() => setShowClothe(true)}>
        Открыть модальное окно 3
      </Button>
      {showClothe && <CreateClothe show={showClothe} handleClose={() => setShowClothe(false)} />}
    </Container>
  );
};

export default Admin;
